package main

import (
	"fmt"

	"github.com/golang-jwt/jwt/v4"
)

const key = "my secure jwt key"

type UserClaim struct {
	jwt.RegisteredClaims
	ID    int
	Email string
	Name  string
}

type Claims struct {
	jwt.RegisteredClaims                      // TODO...
	Audience             string               `json:"aud"`
	Expiration           int64                `json:"exp"`
	IssuedAt             int                  `json:"iat"`
	IssuedBy             string               `json:"iss"`
	Subject              string               `json:"sub"`
	UserID               string               `json:"uid"`
	Scopes               []ClaimsScope `json:"scope"`
	Version              int                  `json:"ver"`
	JwtID                string               `json:"jti"`
}

type ClaimsScope struct {
	TenantID string `json:"tid"`
	Role     string `json:"role"`
}

func main() {
	fmt.Println("JWT")
	fmt.Println()

	// ------------ Generating tokens ------------
	// First, generate a token with an empty payload
	// jwt.RegisteredClaims contains common/standard JWT claims that are usually present in a
	// JWT token payload such as iat (token issue time), exp (token expiry time) and many more.
	token := jwt.NewWithClaims(jwt.SigningMethodHS256, jwt.RegisteredClaims{})
	// For some reason using RS256 gives error: key is invalid
	//token := jwt.NewWithClaims(jwt.SigningMethodRS256, jwt.RegisteredClaims{})
	jwtToken, err := token.SignedString([]byte(key))
	if err != nil {
		fmt.Printf("Error: %v\n", err)
		return
	}
	fmt.Printf("JWT Token: %s\n", jwtToken)

	// Second, generate a token with payload
	// Instead of using jwt.RegisteredClaims directly, use my custom UserClaim
	// which will result in a payload that contains the specified fields
	token = jwt.NewWithClaims(jwt.SigningMethodHS256, UserClaim{
		RegisteredClaims: jwt.RegisteredClaims{},
		ID:               1,
		Email:            "alice.cooper@example.com",
		Name:             "Alice Cooper",
	})
	jwtToken, err = token.SignedString([]byte(key))
	if err != nil {
		fmt.Printf("Error: %v\n", err)
		return
	}
	fmt.Printf("JWT Token: %s\n", jwtToken)

	// ------------ Parsing tokens ------------
	var userClaim UserClaim
	jwtToken = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJJRCI6MSwiRW1haWwiOiJhbGljZS5jb29wZXJAZXhhbXBsZS5jb20iLCJOYW1lIjoiQWxpY2UgQ29vcGVyIn0.DKsnZ25Eapy1ry3LjwTyvIipUJq1QoCtn3DTZyD2qTY"

	// First, parse a token unverified (though this is not recommended)
	parser := jwt.NewParser()
	token, _, err = parser.ParseUnverified(jwtToken, &userClaim)
	fmt.Printf("Parsed User Claim: %d %s %s\n", userClaim.ID, userClaim.Email, userClaim.Name)

	// Second, parse the token verified by providing as 3rd parameter a function that returns the secret key bytes
	token, err = jwt.ParseWithClaims(jwtToken, &userClaim, func(token *jwt.Token) (interface{}, error) {
		return []byte(key), nil
	})
	if err != nil {
		fmt.Printf("Error: %v\n", err)
		return
	}
	// Check token validity
	if !token.Valid {
		fmt.Println("Invalid token!")
		return
	}
	fmt.Printf("Parsed User Claim: %d %s %s\n", userClaim.ID, userClaim.Email, userClaim.Name)

	// ------------ Parsing tokens ------------
	var claims Claims
	jwtToken = "eyJhbGciOiJSUzI1NiIsImlyaSI6ImNmbDNmcjhvMTJtb25nNmtwdXUwIiwia2lkIjoiNTI0ZTQ1MWEtNTdjNy00M2I4LWIwNzQtNTlmMzZiODY4MDVkIn0..xZiJL6fNaC5woABE-YbBFTp_A8Fz98RJxL1AGCVq8UZHqhU4NSuVxz6YT2Hif2-8RlCfL3f57e3y6YcLATwJ3erT8GLGNez9NCG4MFFkNzevS7mTte4yv70MTJBphDpJiYN8AQ5IjKR1bZBJixAVd6dt13PUPnBKDofWrnetnBrNW5VZybDHdC_6tVUbXykWXChSMzyp5DyIIG3P4Amctr-p0NRH1aABHJR4VHlkdPMEP686n--MpUe_9UPJ-Qed6ZTU_dDpwEPNApXXJ_ZCvzGPd2G77DHMMhWyI6eLl_uYkTgx2CDFyQCXUcZOTP_cmtBYJjW8A9AEzbY25r8_pw"
	jwtToken = "eyJhbGciOiJSUzI1NiIsImVhcCI6MSwia2lkIjoiOTA0N2EzNjUtODY3OC00M2U1LTg1MTktM2ZmNjc0ZDNhOTllIn0..en6LAOfrpv9WHSJpvTZxGldLU1X3mjVUf1Ej0frmCaZKe2VlUr7ZeIOguAA9guAqLn77FuHDTTgNhDTyR5XHaWwfoh8ET1GrLxTYCPJTNqTk1HKAznyWcuCKLcmX3s11oY-P624bE-oOcYMP1byHE-1NYRz_r5O9CEg9yRL6sdGYZuVxx1-zb7ZZYWDaxE8DLI4Nad13d8WsAeUeiunWDBmVyQfU_n6mEpk4jY-DaQaY2diS4imTXX_Dk766RLiR3m1ePdlgV7loG63lJc_KoCPF1MYgy5o2hal4qQdq0iwE4V5kDOnKqQbhkMJnXaAQn5surGROqpNmb-oWs4kn_Q"
	parser = jwt.NewParser()
	token, _, err = parser.ParseUnverified(jwtToken, &claims)
	//fmt.Printf("Parsed Claims: %v\n", claims)
	fmt.Printf("Parsed Claims: aud=%s, exp=%d, iat=%d, iss=%s, sub=%s, uid=%s, ver=%d, jti=%s\n", claims.Audience, claims.Expiration, claims.IssuedAt, claims.IssuedBy, claims.Subject, claims.UserID, claims.Version, claims.JwtID)
	fmt.Println("Scopes: ")
	for _, scope := range claims.Scopes {
		fmt.Printf("  %s\n", scope.Role)
	}
}
